        <Grid item xs={6} className='image'>
          <img width='500' height="800"src="https://cdn3.vectorstock.com/i/1000x1000/05/07/isometric-set-of-doctors-nurses-surgeons-vector-24130507.jpg"></img>
        </Grid>
      </Grid>
     </container>
    </div>
  );
}

export default App;
